import React from 'react';
import { Link } from 'react-router-dom';
import games from '../gamesData';

function GameList() {
  return (
    <div>
      {games.map(game => (
        <div className="game-item" key={game.id}>
          <Link to={`/game/${game.id}`}>{game.name}</Link>
        </div>
      ))}
    </div>
  );
}

export default GameList;
